import React from 'react';
import NavStory from './NavStory';
import TextBox from './TextBox';
import ViewStories from './ViewStories';
import appCSS from './app.css';


function App() {
  return (
    <div>
      {/* <NavStory />
      <ViewStories />
      <TextBox /> */}

      <img src="./images/slantedGreenLake.png" id = "Green_Lake" width = "170" alt = "Green Lake"/>
      <button id="plaque_Lake">The Refuge</button>

      <img src = "./images/Ghibili_House.jpg" id = "Ghibili_House" height = "150"  alt = "Ghibili_House"></img>
      <button id="plaque_house">The Ghibili House</button>

      <img src = "./images/Carosel_Path.jpg" id = "Carosel_Path" height = "150"  alt = "Carosel_Path"></img>
      <button id="plaque_Path">The Carosel Path</button>

      <img src="./images/slantedCoolingMist.png" id = "Cooling_Mist" height = "260"  alt = "Cooling Mist"></img>
      <button id="plaque-4">The Cooling Mist</button>

      <img src="./images/closed-door.jpg" id = "closed-door" height = "200"></img>
   </div>
  );
}

export default App;
